const btnFilterByNumeric = (column, number, compare, context) => {
  console.log('cliquei em btn');
  console.log('Number:', number);
  console.log('Compare:', compare);
  console.log('Selector Column:', column);
  console.log('context:', context);

  if (column === 'population' && compare === 'maior que' && number === 0) {
    const filtered = context.filter((result) => result[column] > 0);
    console.log('default:', filtered);
    return filtered;
  }

  if (compare === 'menor que') {
    const filtered = context.filter((result) => Number(result[column]) < number);
    console.log('menor que:', filtered);
    return filtered;
  }

  if (compare === 'maior que') {
    const filtered = context.filter((result) => Number(result[column]) > number);
    console.log('maior que:', filtered);
    return filtered;
  }

  if (compare === 'igual a') {
    console.log(Number(context[column]));
    const filtered = context.find((result) => Number(result[column]) === number);
    console.log('igual a:', filtered);
    return filtered;
  }
};

export default btnFilterByNumeric;
